vis.timeline.components.ItemSet.prototype._onUpdateItem=function(item){if(this.options.selectable&&(this.options.editable.updateGroup||this.options.editable.updateTime)){var me=this;if(item){var itemData=me.itemsData.get(item.id);this.options.onUpdate(itemData,function(itemData){itemData&&me.itemsData.getDataSet().update(itemData)})}}};